import React from "react";
import "./Navbar.css";

const Navbar = () => {

    return (
        <div className = "navbar">
            <ul className = "nav">
                <li>
                    <a href = "#section">HOME</a>
                </li>
                <li>
                    <a href = "#section">ABOUT</a>
                </li>
            </ul>
        </div>
    );
};

export default Navbar;
